export default class Node {
    constructor(id, name, fields, methods, width, height, fontSize = 12, useCSSSizing = false){
        this.id = id;
        this.name = name;
        this.fields = fields;
        this.methods = methods;
        this.width = width;
        this.height = height;
        this.x = 0;
        this.y = 0;
        this.fontSize = fontSize;
        this.useCSSSizing = useCSSSizing;
    }

    toString(){
        return this.name;
    }
}
